const lang = 'en';
const dir = 'ltr';
let canvasClass = 'bmby-poi-wrapp';
let map;
const options = {};

const query = '?key=AIzaSyDuH95F2ljG3Z-AtGByCNYMkaUwwGc-SUc&libraries=places';

function createHtmlElement(parent, elementName, elementTag, elementClass) {
  const el = document.createElement(elementTag);
  if (Array.isArray(elementClass)){
    elementClass.forEach(classElement => {
      el.classList.add(classElement);
    });
  }else{
    el.style.cssText=elementClass;
  }
  el.textContent = elementName;
  if (parent) {
    parent.appendChild(el);
  }
  return el;
}

document.addEventListener("DOMContentLoaded",()=>{
  addPoiToCategory();
  addFont();
  addBasicStyle();
  const scriptInterval = setInterval(()=>{
    addScripts();
    if (scriptsChecker()){
      clearInterval(scriptInterval);
      initMap();
    }
  },200);
});

function addBasicStyle () {
  document.head.innerHTML +='<style>'+resetCss+'</style>';
  document.head.innerHTML +='<style>'+styleCss+'</style>';
}

function addFont() {
  document.head.innerHTML += '<link href="https://fonts.googleapis.com/css2?family=Ubuntu:wght@300;500&display=swap" rel="stylesheet">';
}

function addScripts () {
  const markerCluster = isLoadedScript('https://unpkg.com/@google/markerclustererplus@4.0.1/dist/markerclustererplus.min.js');
  if (!markerCluster){
    loadScript('https://unpkg.com/@google/markerclustererplus@4.0.1/dist/markerclustererplus.min.js');
  }
  const mapApi = isLoadedScript('https://maps.googleapis.com/maps/api/js'+query+'&language='+lang);
  if (!mapApi){
    loadScript('https://maps.googleapis.com/maps/api/js'+query+'&language='+lang)
  }
  const snazzy = isLoadedScript('https://cdn.jsdelivr.net/npm/snazzy-info-window@1.1.1/dist/snazzy-info-window.min.js');
  if (!snazzy){
    loadScript('https://cdn.jsdelivr.net/npm/snazzy-info-window@1.1.1/dist/snazzy-info-window.min.js');
  }
}

async function loadScript(path) {
  const script = document.createElement('script');
  script.type ='text/javascript';
  script.src = path;
  script.async =false;
  document.head.appendChild(script);
}

function isLoadedScript(path) {
  return document.head.querySelectorAll('[src="' + path + '"]').length > 0;
}

function scriptsChecker () {
  return Boolean(window.MarkerClusterer && window.google.maps && window.SnazzyInfoWindow);
}

function initMap () {
  const mapContainer = document.createElement('div');
  mapContainer.classList.add('map__container');
  document.querySelector('.'+canvasClass).append(mapContainer);

  options.filteredMarkers = {};
  options.mapSettings = {
    zoom: 16,
  };

  // Home Marker data
  options.staticMarkers = {
      '0':{
        'title': '251 West 117th Street',
        'lat': 32.0853,
        'lng': 34.7818,
        'markerIcon': generateSvg(poiIcons,'mainBuilding','#C0C0C0','#000000'),
        'markerText': '',
      }
  };

  preparePoiData(options.filteredMarkers);

  const  mapStyle = [
    {
      featureType: "poi",
      stylers: [
        { visibility: "off" }
      ]
    }
  ];

  // const directionsService = new google.maps.DirectionsService;
  // const directionsRenderer = new google.maps.DirectionsRenderer({
  //   suppressMarkers: true,
  //   preserveViewport: true,
  //   provideRouteAlternatives: true,
  // });
  //
  // directionsRenderer.setMap(map);

  const startPoint = new google.maps.LatLng(options.staticMarkers['0'].lat,options.staticMarkers['0'].lng);
  const mapOptions = {
    zoom: options.mapSettings.zoom,
    center: startPoint,
    mapTypeId: google.maps.MapTypeId.ROADMAP,
    mapTypeControl: false,
    streetViewControl: false,
    rotateControl: false,
    styles: mapStyle,
    scrollwheel: true,
    zoomControl: false,
    scaleControl: false,
    fullscreenControl: false,
    gestureHandling : 'cooperative',
  };

  map = new google.maps.Map(mapContainer, mapOptions);

  addStaticMarkers(options);
  addPoiMarkers(options);
  addPoiClusters(options);

  console.log(options);
}

function addPoiListener (marker) {
  const snazzyInfoWindow = new SnazzyInfoWindow({
    marker: marker,
    wrapperClass: 'snazzy-window',
    content: '',
    closeWhenOthersOpen: true,
    panOnOpen: false,
    callbacks: {
      open: () => openSnazzyInfoWindowHandler(marker),
    }
  });
}

function openSnazzyInfoWindowHandler (marker) {
    const placePhoto = getPlacePhoto(marker);
    placePhoto.then((url) => {
      marker.data.infoWindowImg = url;
      const snazzyContainer = document.querySelector('.snazzy-window');
      const createdInfoWindowContent = buildInfoWindowContent(marker);
      snazzyContainer.append(createdInfoWindowContent);
    });
}

function getPlacePhoto (marker) {
  const request = {
    placeId: marker.data.googleMapsID,
    fields: ['photos']
  };

  const service = new google.maps.places.PlacesService(map);

  return new Promise(resolve => {
    service.getDetails(request, (result,status) =>{
      if (status === google.maps.places.PlacesServiceStatus.OK){
        const photos = result.photos;

        if (photos){
          resolve(result.photos[0].getUrl());
        } else {
          resolve(generateSvg(projectIcons, 'POI__PLUG'));
        }

      } else {
        resolve(generateSvg(projectIcons, 'POI__PLUG'));
      }

    });

  });
}

function buildInfoWindowContent (marker) {
  const routeData = convertMarkerDistanceAndTime(marker);

  const mainContainer = createHtmlElement('','','div',['snazzy-content__container']);
  const img = createHtmlElement(mainContainer,'','img',['snazzy-content__img']);
  img.src = marker.data.infoWindowImg;
  const title = createHtmlElement(mainContainer,marker.title,'h3',['snazzy-content__title']);
  const categoryContainer = createHtmlElement(mainContainer,'','div',['snazzy-content__category-container']);
  const categoryImg = createHtmlElement(categoryContainer,'','img',['snazzy-content__category-img']);
  categoryImg.src = marker.category_ic;
  const description = createHtmlElement(mainContainer,marker.markerDescription,'p',['snazzy-content__description']);
  const routeContainer = createHtmlElement(mainContainer,'','div',['snazzy-content__route-container']);
  const routeIconContainer = createHtmlElement(routeContainer,'','div',['snazzy-content__route-icons-container']);
  routeIconContainer.dataset.selectedRoute = 'walk';
  const carIconContainer = createHtmlElement(routeIconContainer,'','div',['snazzy-content__car-route-container']);
  const bikeIconContainer = createHtmlElement(routeIconContainer,'','div',['snazzy-content__bike-route-container']);
  const walkIconContainer = createHtmlElement(routeIconContainer,'','div',['snazzy-content__walk-route-container']);
  const distanceContainer = createHtmlElement(routeContainer,'','div',['snazzy-content__distance-container']);
  const time = createHtmlElement(distanceContainer,routeData.timeToPoint.walk+' mins','span',['snazzy-content__time-route']);
  const separator = createHtmlElement(distanceContainer,' . ','span',['snazzy-content__distance-separator']);
  const distance = createHtmlElement(distanceContainer,routeData.distanceToPoint.walk+' km','span',['snazzy-content__distance-route']);

  return mainContainer;
}

function convertMarkerDistanceAndTime (marker) {
  return {
    distanceToPoint: {
      bike: Number((marker.data.distanceToPoint.bike / 1000).toFixed(1)),
      drive: Number((marker.data.distanceToPoint.drive / 1000).toFixed(1)),
      walk: Number((marker.data.distanceToPoint.walk / 1000).toFixed(1)),
    },
    timeToPoint: {
      bike: Math.round(Number(marker.data.timeToPoint.bike) / 60),
      drive: Math.round(Number(marker.data.timeToPoint.drive) / 60),
      walk: Math.round(Number(marker.data.timeToPoint.walk) / 60)
    }
  }
}


function addPoiClusters (options) {
  let allMarkersForCluster = [];

  Object.values(options.allPoiMarkers).forEach(markers =>{
    allMarkersForCluster = allMarkersForCluster.concat(markers);
  });

    const clusterObj = {
      url: generateSvgCluster('#6E767E'),
      textColor: 'white',
      textSize: 20,
      width: 48,
      height: 44,
    };
    const clusterOptions = {
      ignoreHidden: true,
      styles: [
        clusterObj,
        clusterObj,
        clusterObj,
        clusterObj,
        clusterObj
      ]
    };

  options.clusters = new MarkerClusterer(map, allMarkersForCluster, clusterOptions);
}

function addStaticMarkers (options) {
  Object.values(options.staticMarkers).forEach(marker =>{
    const zIndex = google.maps.Marker.MAX_ZINDEX + 100;
    addMarker(marker, 55, zIndex);
  });
}

function addPoiMarkers (options) {
  options.allPoiMarkers = {};
  Object.entries(options.filteredMarkers).forEach(([category,markers]) =>{
    options.allPoiMarkers[category] = [];
    markers.forEach(marker =>{
      const buildedMarker = addMarker(marker);
      buildedMarker.data = {
        'distanceToPoint': marker.distanceToPoint,
        'timeToPoint': marker.timeToPoint,
        'phone': marker.phone,
        'googleMapsID': marker.googleMapsID,
        'internationalPhone': marker.internationalPhone,
        'webSiteUrl': marker.url,
        'infoWindowImg': marker.infoWindowImg,
      }
      addPoiListener(buildedMarker);
      options.allPoiMarkers[category].push(buildedMarker);
    });
  });
}

function addMarker (marker, staticLabelPosY, zIndex = 1) {
  const title = marker.title;
  const labelPosY = title.length > 15 ? staticLabelPosY || 65 : staticLabelPosY || 55;
  const pos = new google.maps.LatLng(marker.lat, marker.lng);
  const iconImg = new google.maps.MarkerImage();
  iconImg.url = marker.markerIcon;
  iconImg.labelOrigin = new google.maps.Point(18, labelPosY);

  const newMarker = new google.maps.Marker({
    title: title,
    position: pos,
    label: {
      color: '#000000',
      text: title,
      fontWeight: '700',
      textAlign: 'center',
      className: title.length > 15 ? 'long__label-text marker__label' : 'marker__label',
    },
    category: marker.category,
    cluster_ic: marker.clusterIcon,
    category_title: marker.categoryTitle,
    category_zoom: marker.categoryZoom,
    category_ic: marker.categoryImg,
    map: map,
    icon: iconImg,
    animation: google.maps.Animation.DROP,
    zIndex: zIndex,
    color: marker.color,
  });

  return newMarker;
}

function addPoiToCategory () {
  poiCategoriesData.forEach(category =>{
    category.data =[];
    poiData.forEach(poi =>{
      if (Number(category.categoryId) === poi.categoryId){
        category.data.push(poi);
      }
    });
  });
}

function preparePoiData (objectToAssign) {
  const poiWithCategory ={};

  poiCategoriesData.forEach(category =>{
    if (category.data.length > 0){
      const categoryName = category.name.filter(elName=>elName.lang === lang)[0].value;
      poiWithCategory[categoryName] =[];
      category.data.forEach(catData =>{
        const dataName = catData.name.filter(dataElementName => dataElementName.lang === lang)[0].value;
        const description = catData.description.filter(dataDescription => dataDescription.lang === lang)[0].value;
        const obj = {
            'category': categoryName,
            'title': dataName,
            'lat': catData.latitude,
            'lng': catData.longitude,
            'color': category.color,
            'markerIcon': generateSvg(poiIcons,category.icon,'#C0C0C0', category.color),
            'clusterIcon': generateSvgCluster('#6E767E'),
            'categoryTitle': categoryName,
            'categoryZoom': 16,
            'categoryImg': generateSvg(poiIcons,category.iconMenu,'white',category.color),
            'infoWindowImg': 'null',
            'markerDescription': description,
            'distanceToPoint': catData.distanceToPoint,
            'timeToPoint': catData.timeToPoint,
            'phone': catData.phone,
            'googleMapsID': catData.googleMapsID,
            'internationalPhone': catData.internationalPhone,
            'webSiteUrl': catData.url,
        };
        poiWithCategory[categoryName].push(obj);
      });
    }
  });
  Object.assign(objectToAssign,poiWithCategory);
}


function generateSvg (iconColection,icon,color,newColor) {
  let iconSvg;
  const getIcon = iconColection[icon];
  if (getIcon){
    if (color && newColor){
      const regExp = new RegExp(color,'g');
      iconSvg = getIcon.replace(regExp,newColor);
    } else {
      iconSvg = getIcon;
    }
    const encoded = window.btoa(iconSvg);

    return ('data:image/svg+xml;base64,' + encoded);
  } else {
    return generateSvgCluster(color|| '#C0C0C0');
  }
}

